Recently, I published a blogging website (which you are on) to the internet. Surprisingly, both to me and others I know, the development process took less than 4 days. In this post I will outline the main reasons why developing a largely functional website like this was such a simple, quick and easy process.

## But, firstly here is a rundown of the features of this website
1. Login System
2. Logout System
3. User Profile
4. Username
5. Profile Image
6. User Sessions
7. Dynamically created pages
8. Firebase validation
9. Admin pages

Now, the first thing I did in development was create the header of the website, which looked something like this

```html
<header class="site-header bg-white">
  <div class="container full-height">
    <div class="site-header-logo logo flex-align flex-column full-height float-left">
      <h1 class="mg-none pd-none">WebDesignBlog</h1>
      <h2 class="mg-none pd-none"><small>Learn Web Design Easy</small></h2>
    </div>

    <ul class="flex-align site-nav unstyled-list float-right">
      <li><a href="#" class="unstyled-link">Home</a></li>
      <li><a href="#" class="unstyled-link">Blog</a></li>
      <li><a href="#" class="unstyled-link">About</a></li>
      <li><a href="#" class="unstyled-link">Resume</a></li>
      <li><a href="#" class="unstyled-link">Sign Up</a></li>
    </ul>

    <label class="site-sidebar-toggle hamburger">
      <input type="checkbox" class="site-sidebar-input-toggle">
      <span></span>
      <span></span>
      <span></span>
    </label>
  </div>
</header>
```

Of course, as you can see, this site wasn't made using a framework. Personally, although I love frameworks, especially React and React-Native, for "simple" websites like these, I prefer using pure javascript + html + css as it makes the workflow alot simpler.

