Now, i decided to layout the site's layout, which looked something like

- index.html
- about.html
- user.html
- ...
- /js
-     site.js
- /css
-     styles.css

And of course, I *copied* and *pasted* the header 3 times over to create the new pages.

*"Now, I shouldn't be doing this"* - me when copying and pasting

I knew it was wrong, but I didn't know how to solve the simple issue.

So of course, I tried to find help at stackoverflow.com, and after some persistent *researching*, I found some solutions

# Solution 1

```html
<body>
  <?php include "header.html" ?>
</body>
```

# Solution 2

```html
<script>
  $(function() {
    $('.site-header').load('header.html');
  });
</script>
```

Now, I didn't like any of these, for the following reasons:

- Solution 1 required me to use php, which I am not a big fan of
- Solution 2 meant the page loading time would be large, as it had to load external components for every page

# I know what your thinking

*Just Use A Framework*

And that's what I was thinking too. But my development platform is a chromebook, and I don't want to hack my computer in order to be able to use React or Angular.

So, after alot of research, I realised there was a simpler solution:

**In the html page**
```html
<section class="site-component--header"></section>
```
**In javascript**
```js
$(function() {
  $('.site-component--header').replaceWith(`
  <header class="site-header bg-white">
  <div class="container full-height">
    <div class="site-header-logo logo flex-align flex-column full-height float-left">
      <h1 class="mg-none pd-none">WebDesignBlog</h1>
      <h2 class="mg-none pd-none"><small>Learn Web Design Easy</small></h2>
    </div>

    <ul class="flex-align site-nav unstyled-list float-right">
      <li><a href="#" class="unstyled-link">Home</a></li>
      <li><a href="#" class="unstyled-link">Blog</a></li>
      <li><a href="#" class="unstyled-link">About</a></li>
      <li><a href="#" class="unstyled-link">Resume</a></li>
      <li><a href="#" class="unstyled-link">Sign Up</a></li>
    </ul>

    <label class="site-sidebar-toggle hamburger">
      <input type="checkbox" class="site-sidebar-input-toggle">
      <span></span>
      <span></span>
      <span></span>
    </label>
  </div>
</header>
  `);
});
```

Ok, so now that I got components done, what next?

Of course, to add site sections. After adding the relevant markup and css, I decided I needed a better way to organise my styles.

Now, In sass you might do something like
```sass
$primary: #000
```

But I have a chromebook, remember? So I decided to do something like this:
```css
.bg-primary { background: #000 }
```

Not as pretty, but still functional.

Now that the markup was done, It was time to add server connections. I decided to use firebase because it is **easy**. Anyways, setting up a firebase app is as simple as:

```js
firebase.initializeApp({
  apiKey: "Your API Key",
  authDomain: "Your Auth Domain",
  databaseURL: "Your Database URL",
  projectId: "Your Project ID",
  storageBucket: "Your Storage Bucket",
  messagingSenderId: "Your Messaging Sender ID"
});
```

Then you can do stuff like

```js
firebase.auth().createUserWithEmailAndPassword(email, password).then(user => {
  // ...
});
```

Which I thought was cool. So I went on and wrote another **20** lines of code, and viola! I had a login-logout system.

But I decided the user needed a username and a photo, so i added the following:

```js
firebase.auth().createUserWithEmailAndPassword(email, password)
.then(user => {
  firebase.database().ref(`users/${user.uid}`).set({
    name: first + ' ' + last,
    photo: 'data:image/png;base64,'
  })
  .then(() => {
    window.setTimeout(() => {
      window.location.replace('/');
    }, 1000);
  });
})
.catch(error => {
  $warnings.error.html(error.message + '<br><br>');
});
```
btw I store the user's profile image in base64 format just because it is easy.

Next I added the user interface to change these, which meant converting the image onto a canvas to resize it so the base64 wasn't too big. I decided 128x128 was enough.

Next was to add comments, which meant adding a comments option under `posts` in the database.

Now that the functionality was dont, I had one more thing to do. Data validation. Although it is reletavely easy to do in firebase, I think this is one of the pitfalls of the google owned company. All of the data validation is done in a single file, which means that once you add too many fields, It becomes a bowl of Italian Spaghetti. That sucked, but at least it meant the website couldn't get hacked, or at least i think? Please don't hack me...

Anyways, from this I think we can learn a few lessons about web development

1. You don't need a framework. Components can be written in pure javascript with the help of jQuery
2. Use polyfill.io
3. Although I love sass and scss, things similar to variables can be written in css to be used in html
4. Firebase is awesome, but their data validation sucks
5. Stack overflow doesn't have all the answers. It just doesn't
6. Don't use php

Thanks and enjoy the website!
